contracts/modules/Storage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

//import "../interfaces/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract Storage is ReentrancyGuard {
    using SafeERC20 for IERC20;
    IERC20 public usdt;
    //address public owner;
    address public creatorWallet;   
    address public systemMaintance;
    address public teamDevelopment;
    uint public defaultRefId;
    uint public totalUsers;
    uint internal constant maxLayers = 15;

    uint256 public constant PERCENTS_DIVIDER = 10000;
    uint256 public constant TIME_STEP = 1 days;
    uint256 public constant ROI_2X_TIME = 2 days;
    uint256 public constant MONTHLY_ROYALTY_TIME = 100 days;
    uint256 public constant TOP_ROYALTY_TIME = 450 days;
    uint256 public constant ROI_CAP_MULTIPLIER = 15; // 1.5x
    uint256 public constant ROI_CAP_DIVIDER = 10;
    uint256 public constant MONTHLY_ROYALTY_LEVEL = 10;
    uint256 public constant TOP_ROYALTY_LEVEL = 15;
    uint256 public constant MONTHLY_ROYALTY_DIRECT = 5;
    uint256 public constant TOP_ROYALTY_DIRECT = 2;



 
    uint[] public registeredUserIds;
    uint private nonce; // add this at the top of your contract
  
    // Package prices in USDT (with 18 decimals)

        // --- Community bonus accrual (pull-based) ---
    uint256 public constant ACC_PRECISION = 1e18;
    
    uint256 public communityAccPerUser;                 // global accumulator
    //mapping(uint => uint256) internal communityDebt;      // user snapshot

         // --- Community bonus accrual (pull-based) package wise---
   

    // Separate accumulator for each package level
    mapping(uint256 => uint256) public communityAccPerPackage;

    // Separate debt per user per package
    mapping(uint256 => mapping(uint256 => uint256)) public communityDebt; 
    // communityDebt[userId][packageLevel]

    // List of qualified users per package
    mapping(uint256 => uint256) public packageQualifiedUsers; // packageLevel => userId[]

    uint[] public packages = [
        15 * 1e18,      // 15$
        25 * 1e18,      // 25$
        50 * 1e18,      // 50$
        100 * 1e18,     // 100$
        200 * 1e18,     // 200$
        400 * 1e18,     // 400$
        800 * 1e18,     // 800$
        1600 * 1e18,    // 1600$
        3200 * 1e18,    // 3200$
        6400 * 1e18,    // 6400$
        12800 * 1e18,   // 12800$
        25600 * 1e18,   // 25600$
        51200 * 1e18,   // 51200$
        102400 * 1e18,  // 102400$
        204800 * 1e18   // 204800$
    ];

        //  User struct into basic info and relationships

        /*User main struct and mappings*/
    struct Deposit {
        uint256 amount;
        uint256 withdrawn;
        uint256 start; 
        uint8 depositType;  
    }

    struct User {
        address account;
        Deposit[] deposits;
        uint256 checkpoint;
        uint id;
        uint sponsorId;  // Referrer
        uint uplineId;   // Placement in matrix
        uint level;      // Current package level (1-15)
        uint directTeam; // Direct referrals count
        uint directPoolQualified; // Direct referrals count in infinity pool
        uint totalMatrixTeam; // Total users in matrix
        uint totalDeposit;
        uint roiCap;
        uint poollevel;
        uint poolDeposit;
        uint poolStartTime;
        uint boosterlevel;
        uint boosterDeposit;
        uint registrationTime;
        uint level10Time;
        uint level15Time;
        uint monthlyUserDirectCount; // at 10 th level in 100 days
        uint topRoyaltyDirectCount; // // at 15 th level in 450 days
    }
     // struct for bonus calc
    struct UserIncome {
        uint totalIncome;
        uint sponsorIncome;
        uint matrixIncome;
        uint levelBoosterIncome;
        //uint levelIncome;
        uint royaltyIncome;
        uint royaltyIncomeClaimed; // Track claimed royalty for capping
        uint communityIncome;        // <-- NEW: total community bonus claimed
        uint poolIncome;        // <-- Infinity Pool Income
        uint boosterIncome;        // <-- booster Income
        uint weeklyContestIncome;        // <-- weekly contest Income
        uint monthlyRoyalty;        // <-- weekly contest Income
        uint topRoyalty;        // <-- weekly contest Income
    }

    struct UserPackage{       
        uint roiCap;
        uint currentIncome; 
        uint closingAmount; 
        bool qualified;   
        bool closed;
       
    }

    struct Income {
        uint fromUserId;
        uint amount;
        uint packageLevel;
        uint timestamp;
        uint incomeType; // 1: Sponsor, 2: Matrix, 3: Level, 4: Level Booster, 5: Creator, 6: Royalty , 7 Lottery  , 8 Roi Income, 10 Infintiy Pool, 11 Booster Income,12 weekly contest
    }
    enum IncomeType {
        Creator,            // 0
        Sponsor,            // 1
        Matrix,             // 2
        LevelBooster,       // 3        
        Community,          // 4
        Pool,               // 5
        Booster,            // 6
        WeeklyContest,      // 7
        MonthlyRoyalty,     // 8
        TopRoyalty   // 9
    }


    mapping(uint => mapping(uint => UserPackage)) public userPackage;
     mapping(address => uint) public addressToId;
    mapping(uint => User) public users;
    mapping(uint => UserIncome) public userIncomes; // New mapping for income data
    mapping(uint => Income[]) public incomeHistory;
    mapping(uint => mapping(uint => uint[])) public teams; // Matrix team structure by level
    mapping(uint => uint) public matrixDirect; // Count of direct matrix referrals
    mapping(uint => uint[]) public directReferrals;

    event UserJoined(uint8 indexed matrixId, uint32 indexed userId, address indexed user, uint32 parentId, address parentAddr, uint8 position);
    event RewardSent(address indexed to, uint256 amount, string level);


     // Events
    event Registration(address indexed user, address indexed sponsor, uint indexed userId, uint uplineId);
    event Upgrade(address indexed user, uint indexed userId, uint packageLevel, uint packagePrice, string depositType, uint upgradeTime);
    event IncomeDistributed(address indexed to, address indexed from, uint amount, uint packageLevel, uint incomeType);
    event LotteryReward(address indexed winner, uint indexed fromUserId, uint amount, uint timestamp);
    event CommunityBonusDistributed(uint amount, uint usersCount, uint perUser);
    event IncomeDistribution( address indexed to, uint indexed toId, uint indexed fromId,uint256 amount,uint256 packageLevel,IncomeType incomeType,uint256 timestamp);
  
    // Infinity Pool and booster bonus 


    uint[] public poolPackages = [75e18, 300e18, 1200e18, 4800e18, 19200e18, 76800e18, 307200e18];
    uint[] public glbBoosterPackages = [ 100e18, 200e18, 400e18, 800e18, 1600e18, 3200e18, 6400e18, 12800e18];
    uint[7] public minLevelForPool = [3, 5, 7, 9, 11, 13, 15];
    uint[8] public minLevelForGlbBooster = [4, 5, 6, 7, 8, 9, 10,11];
    uint[8] public minPoolForGlbBooster = [0, 1, 1, 1, 1, 1, 1,1];


    struct UserPool {
        uint id;               
        uint mainid;
        uint poolId;
        uint parentId;  
        uint bonusCount;            
    }
    
    struct UserPoolTopup{
        uint nextPoolAmt;       
        uint reTopupAmt;     
    }

      // Golbal Booster
    struct UserBooster {
        uint id; 
        uint poolId;
        uint parentId;  
        uint bonusCount;
         uint joinTime;            
    }

    /* mapping for Infinity Pool*/
    mapping(uint =>  mapping(uint => UserPoolTopup)) public userPooltopup;

    mapping(uint =>  mapping(uint => UserPool)) public userPooldtl;
    mapping(uint => mapping(uint => uint[])) public userChildren;// in each pool id wise
    mapping(uint => mapping(uint => uint[])) public userIdPerPool;// will store user ids pool wise
    mapping(uint => uint[]) public poolUsers; // store all users  pool wise
    mapping(uint => mapping(uint => bool)) public userHasPool; 

    /* mapping for Global Booster */
    mapping(uint =>  mapping(uint => UserBooster)) public userBoosterdtl;
    mapping(uint =>  mapping(uint => uint[])) public userBoosterChildren;
    mapping(uint => uint[]) public boosterUsers;  // store all users booster wise
    mapping(uint => mapping(uint => bool)) public userHasbooster; 

   
    // weekly contest

    uint public constant WEEK_DURATION = 7 days;   
    uint public constant WeeklyCapping = 1000e18;
 

    uint public currentWeeklyRound = 0;
    uint public currentWeeklyStartTime = 0;  
    uint public WeeklyTotalReward = 0;
   


    struct WeeklyContest {
        uint roundId;    
        uint totalReward;
        uint totalUsers;
        uint perUserReward;
        uint claimedCount;
        uint startTime;
        uint endTime;
        uint carryForward;
        bool closed;
    }
   
    struct weeklyUser{
      
        uint joinTime;
        uint roundId ;
        uint claimTime;
        bool isClaimed; 
        bool isQualified;
    }
    mapping (uint => WeeklyContest) public weeklyContestdtl;// details of weekly contest
    mapping(uint=> uint[]) public weeklyQualifiedUsers; // qualifieduserweekly
    mapping(uint => mapping(uint => weeklyUser)) public weeklyUserdtl;// details of weekly user))
    mapping(uint => mapping(uint => uint[])) public weeklyUserDirects;//details users direct in current weekly round
    event WeeklyClosed(uint roundId, uint totalUsers, uint perUserReward, uint totalReward, uint totalDistributed, uint leftoverReward, uint endTime);
    event WeeklyRewardClaim(uint roundId, uint userId, uint perUserReward,  uint claimTime);
    event WeeklyContestQualified(uint roundId, uint userId, uint joinTime);

    //, monthly royalty and top royalty

    
    uint public constant MONTH_DURATION = 30 days;
    uint public constant monthlyCapping = 10000e18;

  
    uint public currentMonthlyRound = 1;
    uint public currentMonthlyStartTime = 0;
    uint public monthlyTotalReward = 0;

    struct monthlyRoyalty {
        uint roundId;    
        uint totalReward;
        uint totalUsers;
        uint perUserReward;
        uint claimedCount;
        uint startTime;
        uint endTime;
        uint carryForward;
        bool closed;
    }

    struct monthlyRoyaltyUser{
      
        uint joinTime;
        uint qualifiedRoundId ;
        uint claimTime;
        mapping(uint => bool) isClaimed; 
        bool isQualified;
    }
    mapping (uint => monthlyRoyalty) public monthlyRoyaltydtl;// details of monthly royalty
    uint[] public monthlyQualifiedUsers; // qualified user monthly royalty
    mapping(uint => monthlyRoyaltyUser) public monthlyRoyaltyUserdtl;
    mapping(uint => uint[]) public monthlyUserDirects;//details users direct in monthly Royalty at 10th level

    event MonthlyClosed(uint roundId, uint totalUsers, uint perUserReward, uint totalReward, uint totalDistributed, uint leftoverReward, uint endTime);
    event MonthlyRewardClaim(uint roundId, uint userId, uint perUserReward,  uint claimTime);
    event MonthlyRoyaltyQualified(uint roundId, uint userId, uint joinTime);

      //, Top royalty
  
    uint public topRoyaltyRound = 1;
    uint public topRoyaltyStartTime = 0;
    uint public topRoyaltyReward = 0;

    struct topRoyalty {
        uint roundId;    
        uint totalReward;
        uint totalUsers;
        uint perUserReward;
        uint claimedCount;
        uint startTime;
        uint endTime;
        uint carryForward;
        bool closed;
    }

    struct topRoyaltyUser{
      
        uint joinTime;
        uint qualifiedRoundId ;
        uint claimTime;
        mapping(uint => bool) isClaimed; 
        bool isQualified;
    }
    mapping (uint => topRoyalty) public topRoyaltydtl;// details of top royalty contest
    uint[] public topRoyaltyQualifiedUsers; // qualified user top royalty
    mapping(uint => topRoyaltyUser) public topRoyaltyUserdtl;
    mapping(uint => uint[]) public topRoyaltyUserDirects;//details users direct in top Royalty at 15th level

    event TopRoyaltyClosed(uint roundId, uint totalUsers, uint perUserReward, uint totalReward, uint totalDistributed, uint leftoverReward, uint endTime);
    event TopRoyaltyRewardClaim(uint roundId, uint userId, uint perUserReward,  uint claimTime);
    event TopRoyaltyQualified(uint roundId, uint userId, uint joinTime);



   
    constructor() {
       
    }
      
    

    function _sendToCreator(uint _amount) internal {
    require(creatorWallet != address(0),"fee addrs not set");
    // 100% split to creator
    
    // Send dust to creator (you can pick any bucket)
    usdt.safeTransfer(creatorWallet, _amount);
  

    // Bookkeeping for the full routed amount
    UserIncome storage creatorIncome = userIncomes[defaultRefId];
    creatorIncome.totalIncome += _amount;

    // incomeHistory[defaultRefId].push(Income({
    //     fromUserId: 0,
    //     amount: _amount,
    //     packageLevel: 0,
    //     timestamp: block.timestamp,
    //     incomeType: 5
    // }));
    emit IncomeDistribution(creatorWallet, defaultRefId, defaultRefId, _amount, 0, IncomeType.Creator, block.timestamp );
}


    function _distributeIncome(uint _userId,uint _fromUserId,uint _amount, uint _packageLevel, IncomeType _incomeType) internal {
        User storage user = users[_userId];
        address userAddress = user.account;
        require(userAddress != address(0), "Invalid user");
        require(_amount > 0, "Zero amount");


        // Transfer tokens
        //usdt.safeTransfer(userAddress, _amount);
    //( userAddress, _amount);

        UserIncome storage income = userIncomes[_userId];
        if(_incomeType != IncomeType.Booster && _incomeType != IncomeType.Pool){
              income.totalIncome += _amount;
        }
      
            // --- Update specific income field based on type ---
        if      (_incomeType == IncomeType.Sponsor) income.sponsorIncome += _amount;
        else if (_incomeType == IncomeType.Matrix) income.matrixIncome += _amount;
        else if (_incomeType == IncomeType.LevelBooster) income.levelBoosterIncome += _amount;  
        else if (_incomeType == IncomeType.Community) income.communityIncome += _amount;   
        else if (_incomeType == IncomeType.Pool) income.poolIncome += _amount;
        else if (_incomeType == IncomeType.Booster) income.boosterIncome += _amount;
        else if (_incomeType == IncomeType.WeeklyContest) income.weeklyContestIncome += _amount;
        else if (_incomeType == IncomeType.MonthlyRoyalty) income.monthlyRoyalty += _amount;
        else if (_incomeType == IncomeType.TopRoyalty) income.topRoyalty += _amount;
        else revert("Unknown income type");

        //uint[] memory packagesdtl = packages;

    
        uint totalIncome = income.totalIncome;
        uint ROICap = user.roiCap; //15 = 1.5x and 20 = 2x
        for (uint i = 0; i < user.level; i++) {
            uint packagePrice = packages[i];
            UserPackage storage pkg = userPackage[_userId][packagePrice];
           
            if (!pkg.closed && totalIncome >= (packagePrice * ROICap) / ROI_CAP_DIVIDER) {
                pkg.closed = true;
                pkg.closingAmount = (packagePrice * ROICap) / ROI_CAP_DIVIDER;
                pkg.roiCap = ROICap;
                totalIncome -= pkg.closingAmount;
                packageQualifiedUsers[packagePrice] -= 1;
            }else if (pkg.closed && totalIncome > (packagePrice * ROICap) / ROI_CAP_DIVIDER){
                 totalIncome -= pkg.closingAmount;
            }else if (!pkg.closed && totalIncome < (packagePrice * ROICap) / ROI_CAP_DIVIDER) {
                pkg.currentIncome = totalIncome;
                break;
            }
        }
    
        usdt.safeTransfer(userAddress, _amount);
        emit IncomeDistribution(userAddress, _userId, _fromUserId, _amount,_packageLevel, _incomeType, block.timestamp );
        //emit IncomeDistributed(userAddress, users[_fromUserId].account, _amount, _packageLevel, _incomeType);
    }

    function _tryWeeklyContestQualify(uint _userId, uint _roundId)internal {
            if (!weeklyUserdtl[_roundId][_userId].isQualified) {
                    _weeklyContestQualifier(_userId, _roundId);
            }
    }

    function _weeklyContestQualifier(uint _userId, uint _roundId)internal {
       
       // uint currentRound = currentWeeklyRound;        
        require(_roundId == currentWeeklyRound, "Invalid round");
        require(!weeklyContestdtl[_roundId].closed, "Round closed");
        UserBooster memory userBoosterJoinDtl = userBoosterdtl[1][_userId];

        bool hasEnoughDirects = weeklyUserDirects[_roundId][_userId].length >= 5;
        bool boosterEarlyJoin = (
            userBoosterJoinDtl.id == _userId && 
            userBoosterJoinDtl.joinTime <= users[_userId].registrationTime + TIME_STEP
        );
        require(hasEnoughDirects || boosterEarlyJoin, "Not eligible for weekly contest");
        //require(weeklyUserDirects[currentRound][_userId].length >=5 ||  (userBoosterJoinDtl.id == _userId && userBoosterJoinDtl.joinTime <= users[_userId].registrationTime + TIME_STEP), "not eligible"); // (userBoosterJoinDtl.id = _userId && userBoosterJoinDtl.joinTime <= users[_userId].registrationTime)
        
        weeklyUser storage weeklyuserdtl = weeklyUserdtl[_roundId][_userId];
        if (weeklyuserdtl.isQualified) return;
        require(!weeklyuserdtl.isQualified, "already Qualified");

        uint nowTime = block.timestamp;
        weeklyQualifiedUsers[_roundId].push(_userId);// += 1;
        weeklyuserdtl.joinTime = nowTime;
        weeklyuserdtl.roundId = _roundId;
        weeklyuserdtl.isQualified = true;
   
        emit WeeklyContestQualified(_roundId, _userId, nowTime);
    }

    function _tryMonthlyRoyaltyQualify(uint _userId, uint _roundId)internal {
            if (!monthlyRoyaltyUserdtl[_userId].isQualified) {
                    _monthlyRoyaltyQualifier(_userId, _roundId);
            }
    }

    function _monthlyRoyaltyQualifier(uint _userId, uint _roundId)internal {      
       
        require(_roundId == currentMonthlyRound, "Invalid round");
        require(!monthlyRoyaltydtl[_roundId].closed, "Round closed");
       
        User storage user = users[_userId];        

        require(user.level10Time > 0, "User not level 10");
        bool withinTime = user.level10Time <= user.registrationTime + MONTHLY_ROYALTY_TIME;
        bool qualifiedByLevel = user.level >= MONTHLY_ROYALTY_LEVEL;
        bool qualifiedByDirects = user.monthlyUserDirectCount >= MONTHLY_ROYALTY_DIRECT;
        require(withinTime && qualifiedByLevel && qualifiedByDirects, "Not eligible");
        
        monthlyRoyaltyUser storage userRoyalty  = monthlyRoyaltyUserdtl[_userId];
       
        //if (userRoyalty.isQualified) return;
        require(!userRoyalty.isQualified, "already Qualified");

        uint nowTime = block.timestamp;
        //userRoyalty.id = _userId;
        monthlyQualifiedUsers.push(_userId);
        userRoyalty.joinTime = nowTime;
        userRoyalty.qualifiedRoundId = _roundId;
        userRoyalty.isQualified = true;
   
        emit MonthlyRoyaltyQualified(_roundId, _userId, nowTime);
    }

    

    function _tryTopRoyaltyQualify(uint _userId, uint _roundId)internal {
            if (!topRoyaltyUserdtl[_userId].isQualified) {
                    _topRoyaltyQualifier(_userId, _roundId);
            }
    }

    function _topRoyaltyQualifier(uint _userId, uint _roundId)internal {      
       
        require(_roundId == topRoyaltyRound, "Invalid round");
        require(!topRoyaltydtl[_roundId].closed, "Round closed");
       
        User storage user = users[_userId];        

        require(user.level15Time > 0, "User not level 15");
        bool withinTime = user.level15Time <= user.registrationTime + TOP_ROYALTY_TIME;
        bool qualifiedByLevel = user.level >= TOP_ROYALTY_LEVEL;
        bool qualifiedByDirects = user.topRoyaltyDirectCount >= TOP_ROYALTY_DIRECT;
        require(withinTime && qualifiedByLevel && qualifiedByDirects, "Not eligible");
        
        topRoyaltyUser storage userRoyalty  = topRoyaltyUserdtl[_userId];
       
        //if (userRoyalty.isQualified) return;
        require(!userRoyalty.isQualified, "already Qualified");

        uint nowTime = block.timestamp;
        //userRoyalty.id = _userId;
        topRoyaltyQualifiedUsers.push(_userId);
        userRoyalty.joinTime = nowTime;
        userRoyalty.qualifiedRoundId = _roundId;
        userRoyalty.isQualified = true;
   
        emit MonthlyRoyaltyQualified(_roundId, _userId, nowTime);
    }

    function _closeTopRoyalty() internal {
        
        if (block.timestamp < topRoyaltyStartTime + MONTH_DURATION) return;
        uint currentRound = topRoyaltyRound;
        topRoyalty storage curentTopRoyalty = topRoyaltydtl[currentRound];

        // Prevent double closing
        // if (curentMonthRoyalty.endTime > 0 && block.timestamp < curentMonthRoyalty.endTime) {
        //     return;
        // }
        if (curentTopRoyalty.closed) return;
        uint qualifiedCount = topRoyaltyQualifiedUsers.length;
        uint perUserReward;
        uint distributedAmount;
        uint leftover;

        if (qualifiedCount > 0) {
            // Calculate reward distribution              
            
            perUserReward = topRoyaltyReward / qualifiedCount;
            distributedAmount = perUserReward * qualifiedCount;
            leftover = topRoyaltyReward - distributedAmount;
        } else {
            // No qualified users → carry forward all
            leftover = topRoyaltyReward;
            distributedAmount = 0;
            perUserReward = 0;
        }

        // Store round data
        curentTopRoyalty.roundId = currentRound;
        curentTopRoyalty.perUserReward = perUserReward;
        curentTopRoyalty.totalUsers = qualifiedCount;
        curentTopRoyalty.totalReward = topRoyaltyReward;//distributedAmount;
        curentTopRoyalty.carryForward = leftover;
        curentTopRoyalty.endTime = topRoyaltyStartTime + MONTH_DURATION;
        curentTopRoyalty.closed = true;

        // Prepare next round
        topRoyaltyStartTime = curentTopRoyalty.endTime;
        topRoyaltyRound = currentRound + 1;
        topRoyaltyReward = leftover; // carry forward

        emit TopRoyaltyClosed(currentRound, qualifiedCount, perUserReward,  distributedAmount+leftover, distributedAmount, leftover, curentTopRoyalty.endTime);
        
    }

      
    function _closeMonthlyRoyalty() internal {
        
        if (block.timestamp >= (currentMonthlyStartTime + MONTH_DURATION)) {
            uint currentRound = currentMonthlyRound;
            monthlyRoyalty storage curentMonthRoyalty = monthlyRoyaltydtl[currentRound];

            // Prevent double closing
            // if (curentMonthRoyalty.endTime > 0 && block.timestamp < curentMonthRoyalty.endTime) {
            //     return;
            // }
            if (curentMonthRoyalty.closed) return;
            uint qualifiedCount = monthlyQualifiedUsers.length;
            uint perUserReward;
            uint distributedAmount;
            uint leftover;

            if (qualifiedCount > 0) {
                // Calculate reward distribution
                uint rawReward = monthlyTotalReward / qualifiedCount;
                perUserReward = (rawReward > monthlyCapping) ? monthlyCapping : rawReward;
                distributedAmount = perUserReward * qualifiedCount;
                leftover = (monthlyTotalReward > distributedAmount) ? monthlyTotalReward - distributedAmount : 0;
            } else {
                // No qualified users → carry forward all
                leftover = monthlyTotalReward;
                distributedAmount = 0;
                perUserReward = 0;
            }

            // Store round data
            curentMonthRoyalty.roundId = currentRound;
            curentMonthRoyalty.perUserReward = perUserReward;
            curentMonthRoyalty.totalUsers = qualifiedCount;
            curentMonthRoyalty.totalReward = monthlyTotalReward;//distributedAmount;
            curentMonthRoyalty.carryForward = leftover;
            curentMonthRoyalty.endTime = currentMonthlyStartTime + MONTH_DURATION;
            curentMonthRoyalty.closed = true;

            // Prepare next round
            currentMonthlyStartTime = curentMonthRoyalty.endTime;
            currentMonthlyRound = currentRound + 1;
            monthlyTotalReward = leftover; // carry forward

            emit MonthlyClosed(currentRound, qualifiedCount, perUserReward,  distributedAmount+leftover, distributedAmount, leftover, curentMonthRoyalty.endTime);
        }
    } 


    function _closeWeeklyContest() internal {
        
        if (block.timestamp >= (currentWeeklyStartTime + WEEK_DURATION)) {
            uint currentRound = currentWeeklyRound;
            WeeklyContest storage curentWeekContest = weeklyContestdtl[currentRound];

            // Prevent double closing
            // if (curentWeekContest.endTime > 0 && block.timestamp < curentWeekContest.endTime) {
            //     return;
            // }
            if (curentWeekContest.closed) return;

            uint qualifiedCount = weeklyQualifiedUsers[currentRound].length;
            uint perUserReward;
            uint distributedAmount;
            uint leftover;

            if (qualifiedCount > 0) {
                // Calculate reward distribution
                uint rawReward = WeeklyTotalReward / qualifiedCount;
                perUserReward = (rawReward > WeeklyCapping) ? WeeklyCapping : rawReward;
                distributedAmount = perUserReward * qualifiedCount;
                leftover = (WeeklyTotalReward > distributedAmount) ? WeeklyTotalReward - distributedAmount : 0;
            } else {
                // No qualified users → carry forward all
                leftover = WeeklyTotalReward;
                distributedAmount = 0;
                perUserReward = 0;
            }

            // Store round data
            curentWeekContest.roundId = currentRound;
            curentWeekContest.perUserReward = perUserReward;
            curentWeekContest.totalUsers = qualifiedCount;
            curentWeekContest.totalReward = WeeklyTotalReward;//distributedAmount;
            curentWeekContest.carryForward = leftover;
            curentWeekContest.endTime = currentWeeklyStartTime + WEEK_DURATION;
            curentWeekContest.closed = true;

            // Prepare next round
            currentWeeklyStartTime = curentWeekContest.endTime;
            currentWeeklyRound = currentRound + 1;
            WeeklyTotalReward = leftover; // carry forward

             emit WeeklyClosed(currentRound, qualifiedCount, perUserReward,  distributedAmount+leftover, distributedAmount, leftover, curentWeekContest.endTime);
        }
    }   


